import './App.css';
import Header from "./Header";

const App = () => {
    return (
        <div className="App">
            <div>
                <Header />
            </div>
            <ul>
                <li>Фильмы</li>
                <li>Мультфильмы</li>
                <li>Игры</li>
                <li>Порно</li>
            </ul>
        </div>
    );
}

export default App;
